import { Grid, GridItem, Show } from "@chakra-ui/react";
import NavBar from "./components/NavBar";

function App() {
  return (
    <Grid
      templateAreas={{
        base: `"nav" "main"`,
        lg: `"nav nav" "aside main"`,
      }}
    >
      <GridItem area="nav" color="red">
        <NavBar />
      </GridItem>
      <Show above="lg">
        <GridItem area="aside" color="yellowgreen">
          Aside
        </GridItem>
      </Show>
      <GridItem area="main" color="blue">
        Main
      </GridItem>
    </Grid>
  );
}

export default App;
